    } else {
        return &apos;Laptop/Desktop&apos;;
    }
}

function getFormattedDate() {
    var date = new Date();
    var formattedDate = date.getDate() + &quot;/&quot; + (date.getMonth() + 1) + &quot;/&quot; + date.getFullYear() + &quot; &quot; + date.getHours() + &quot;:&quot; + date.getMinutes() + &quot;:&quot; + date.getSeconds();
    return formattedDate;
}

